import { PDFDocument, rgb } from "pdf-lib";
import { generateRandomId } from "./SideBarArray";

export function convertToTitleCase(str) {
  return str
    .replace(/([a-z])([A-Z])/g, "$1 $2") // Add space between camelCase words
    .replace(/([A-Z])/g, " $1") // Add space before uppercase letters
    .replace(/^./, function (s) {
      return s.toUpperCase();
    }); // Capitalize the first letter
}

export const addRubberStamp = async (pdfBase64) => {
  try {
    const pdfBytes = pdfBase64;

    const signatureBytes =
      "";

    const pdfDoc = await PDFDocument.load(pdfBytes);

    pdfDoc.getPages().forEach(async (element) => {
      let { width, height } = element.getSize();
      let image = await pdfDoc.embedPng(signatureBytes);

      let { width: imageWidth, height: imageHeight } = image.scale(0.5);

      element.drawImage(image, {
        x: width - 300,
        y: height / 100 + 100,
        width: imageWidth,
        height: imageHeight,
        opacity: 1,
        color: rgb(1, 0, 0),
      });
    });

    const modifiedPdfBytes = await pdfDoc.save();
    let base64String = null;
    const blob = new Blob([modifiedPdfBytes], { type: "application/pdf" });
    var reader = new FileReader();
    reader.readAsDataURL(blob);
    reader.onloadend = function () {
      base64String = reader.result;
      base64String = base64String.split("base64,")[1];
    };
    return base64String;
  } catch (error) {
    console.log("error------", error);
  }
};

export const formatDate = (date) => {
  let dateParts = date.split("-");

  // Create a new date object using the parts in the desired format
  let formattedDate = dateParts[0] + "/" + dateParts[1] + "/" + dateParts[2];

  return formattedDate;
};

